class Solution:
    def findAnagrams(self, s: str, p: str) -> 'List[int]':
        arr1 = [0 for _ in range(26)] # using array as map, to store how many times the character appears
        arr2 = [0 for _ in range(26)]
        a = ord('a') 
        for c in p:
            arr1[ord(c) - a] += 1
        
        output = []
        for i, c in enumerate(s):
            if i >= len(p): # take out the previous character
                prev = s[i-len(p)]
                arr2[ord(prev) - a] -= 1 
            
            arr2[ord(c)-a] += 1   # add current character to the map 
            
            if arr1 == arr2:
                output.append(i+1-len(p)) #return the start location of the current segment
        
        return output
                
        


